actionConfiguration.body:
{{
JSON.stringify({
	variables: {
			warehouse:selectWarehouse.selectedOptionValue
		},
    query: `
query QueryJobOrdersWarehouse($warehouse:String!) {
  queryJobOrder (filter: { dispatchStatus: { eq: CREATED } }){
    id
    name
    dispatchStatus
    operationsRequest{
			id
			equipment (filter: { name: { eq: $warehouse}}){
				id
			}
		}
		jobResponses (first: 1 order: { asc: startDateTime }){
				id    
    }
  }
}
    `
})
}}

